import React from "react";
import { Link } from "react-router-dom";
import { Wrapper, StyledSection } from "../../components/Wrapper/styles";

export const LoginScreen = () => {
  return (
    <Wrapper>
      <StyledSection>
        <p>Log in to the blog</p>
        <input type="email" />
        <input type="password" />
        <button>
          <Link to="/main">Go </Link>
        </button>
      </StyledSection>

      <StyledSection>
        <p>Go to blog without logging in</p>
        <button>
          <Link to="/main">Go without</Link>
        </button>
      </StyledSection>
    </Wrapper>
  );
};
